import React from 'react';
import { Tabs, Tab } from 'react-bootstrap';

const TabComponent = () => {
    const tabStyle = {
        position: 'fixed', // O 'absolute' si estás dentro de un contenedor relativo
        top: '35%',
        right: '50px',
        transform: 'translateY(-50%)',
        zIndex: 1000, // Asegura que esté sobre otros elementos
        width: '553px', // Ancho fijo
        height: '385px', // Altura fija
        overflow: 'auto' // Añadir scroll si el contenido es muy grande
 // otros estilos que necesites
    };
    const tabContentStyle = {
        backgroundColor: 'white', // Fondo blanco para el contenido
        borderRadius: '10px', // Bordes redondeados
        padding: '15px', // Espaciado interno
        height: '100%', // Altura completa del contenedor de pestañas
        overflowY: 'auto' // Desplazamiento vertical si es necesario
    };

    return (
        <div style={tabStyle}>
            <Tabs defaultActiveKey="filtrosVisuales" id="tab-component" className="mb-3">
                <Tab eventKey="filtrosVisuales" title="Filtros visuales">
                    {/* Contenido de Tab 1 */}
                    <div style={tabContentStyle}>
                    <label htmlFor="input1">Label 1</label>
                    <input type="text" id="input1" />
                    <label htmlFor="input2">Label 2</label>
                    <input type="text" id="input2" />
                </div>
                </Tab>
                <Tab eventKey="barrasPedidos" title="Barras & Pedidos">
                    {/* Contenido de Tab 2 */}
                    <div style={tabContentStyle}>
                    <table>
                    <thead>
                        <tr>
                            <th>Columna 1</th>
                            <th>Columna 2</th>
                            <th>Columna 3</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>Dato 1</td>
                            <td>Dato 2</td>
                            <td>Dato 3</td>
                        </tr>
                        {/* Agrega más filas según sea necesario */}
                    </tbody>
                </table>
                </div>
                </Tab>
            </Tabs>
        </div>
    );
};

export default TabComponent;
